import React from 'react';
import './App.css';
import Person from './Person/Person'

function App() {

  state = {
    person:[
      {name: 'Steven', age: 23},
      {name: 'Mike', age: 17},
      {name: 'Richard', age: 63}
    ]
  }

  return (
   <Person name='Steven' age='23'>Nested text in Person</Person>
  );
}

export default App;
